import React, { Component } from "react";

export default class Links extends Component {
  render() {
    return (
      <div>
        <ul>
          <a href="/about">
            <li style="color: white; font-size: 30px;">ABOUT</li>
          </a>
          <a href="/contact">
            <li style="color: white; font-size: 30px;">CONTACT</li>
          </a>
          <a href="/credits">
            <li style="color: white; font-size: 30px;">CREDITS</li>
          </a>
        </ul>
      </div>
    );
  }
}
